import React, { useState } from "react";
import AboutMe from "./components/AboutMe";
import Writing from "./components/Writing";
import Resume from "./components/Resume";
import "./App.css";

function App() {
	const [currentPage, setCurrentPage] = useState("home");

	const navigate = (page) => {
		setCurrentPage(page);
	};

	return (
		<div>
			<header>
				<h1>Naail Lakhani</h1>
			</header>
			<nav>
				<a onClick={() => navigate("home")}>Home/About Me</a>
				<a onClick={() => navigate("writing")}>Writing</a>
				<a onClick={() => navigate("resume")}>Resume</a>
			</nav>
			<main>
				{currentPage === "home" && <AboutMe />}
				{currentPage === "writing" && <Writing />}
				{currentPage === "resume" && <Resume />}
			</main>
		</div>
	);
}

export default App;
